  "title": {
    "nb": "Storulykkeanlegg"
  },
  "description": {
    "nb": "Datasettet viser alle anlegg i Norge som faller inn under storulykkeforskriften (forskrift om tiltak for å forebygge og begrense skadevirkningene av storulykker i virksomheter der farlige kjemikalier forekommer). Om lag 300 norske virksomheter er regulert av storulykkeforskriften. Dette er i stor grad prosessindustri, kjemisk industri, tankanlegg og eksplosivlagre. Storulykkeforskriften implementerer de kravene som stilles til virksomheter gjennom EU-direktivet Seveso III, og håndheves av følgende myndigheter: Miljødirektoratet, Direktoratet for Arbeidstilsynet, Direktoratet for samfunnssikkerhet og beredskap (DSB), Petroleumstilsynet og Næringslivets sikkerhetsorganisasjon.\nDatasettet gis bare ut til bruk i kommunal og regional beredskap, arealplanlegging og byggesaksbehandling og bare ved direkte henvendelse til DSB v/ kart@dsb.no eller karen.lie@dsb.no\nPå grunn av restriksjonene på dataene er de bare tilgjengelige for utvalgte brukere. Dette vil være brukere innenfor arealplanlegging, byggesaksbehandling og samfunnssikkerhet/beredskap. Dataene fås bare ved direkte henvendelse til DSB: kart@dsb.no eller karen.lie@dsb.no"
  },
