    "nb": "Datasettet viser anlegg med farlig stoff, dvs. brannfarlig og giftig gass, stoff og væske.\n\nDataene er etablert ved innmelding fra eierne av anleggene. DSB har derfor liten kontroll med kvaliteten på stedfestingen.\n\nDSB gjør disse dataene tilgjengelig bare for utvalgte brukere innenfor Norge digitalt. Dette vil særlig være brukere innenfor arealplanlegging, byggesaksbehandling og beredskap. Disse får bare tilgang til data for eget distrikt. Dataene fås bare ved direkte henvendelse til DSB v/ Karen Lie.\n\nBrukeretatene må forplikte seg til å behandle dataene slik at de bare er tilgjengelig for brukere med reelt behov for informasjonen. Dataene kan ikke legges på åpne kartapplikasjoner på internett.\n\nDSB har en online-løsning, FAST, som krever brukernavn og passord, og som gjøres tilgjengelig for de samme brukergruppene som vektordataene. FAST består av en kartløsning med farlig stoff-dataene og en database med mer informasjon om anleggene. Se DSBs nettsider https://www.dsb.no/lover/farlige-stoffer/artikler/fast---anlegg-og-kart/"
