  "description": {
    "nb": "Datasettet viser lokalisering av brannalarmsentralene (\"110-sentralene\") i Norge og deres distrikter.\nNorge har i dag 14 brannalarmsentraler som mottar meldinger om brann og ulykker på vegne av landets brannvesen. De skal etter hvert bli samlokalisert med politiets operasjonssentraler med samme distriktsinndeling. \nSentralene er stedfestet til bygning. Distriktene følger kommunegrenser."
  },
